import React from "react";
import cartIcon from "../cart.svg";

const Cart = () => {
	return (
		<p>
			<img
				src={cartIcon}
				height="30"
				alt="cart icon"
				style={{
					marginTop: "3px",
					marginBottom: "0px",
					paddingBottom: "0px",
				}}
			/>
		</p>
	);
};

export default Cart;
